import { ExpandMore } from "@mui/icons-material";
import {
  Accordion,
  AccordionDetails,
  AccordionSummary,
  Typography,
} from "@mui/material";
import React from "react";
export default function Groups({ group }) {
  return (
    <Accordion sx={accordionStyle}>
      <AccordionSummary expandIcon={<ExpandMore />} id={group.id}>
        <Typography>{group.name}</Typography>
      </AccordionSummary>
      <AccordionDetails>
        <Typography align="center" variant="h6">
          {group.count.join(", ")}
        </Typography>
      </AccordionDetails>
    </Accordion>
  );
}

const accordionStyle = {
  width: "80rem",
  maxWidth: "90vw",
};
